import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Turismo.css'; // Certifique-se de que este arquivo exista

function Turismo() {
  return (
    <div className="turismo-page">
      <Header />
      <main>
        <h1>Turismo</h1>
        <p>Conteúdo provisório para a página de turismo.</p>
      </main>
      <Footer />
    </div>
  );
}

export default Turismo;
